// react-pdf-co-viewer/src/components/Navigation.js
import React from 'react';

function Navigation({ pageNumber, numPages, onPrevious, onNext }) {
  return (
    <div className="navigation">
      <button onClick={onPrevious} disabled={pageNumber <= 1}>
        Previous
      </button>
      <button onClick={onNext} disabled={pageNumber >= numPages}>
        Next
      </button>
      <p>
        Page {pageNumber} of {numPages}
      </p>
    </div>
  );
}

export default Navigation;
